{"post_stream":{"posts":[{"id":3142055,"name":"Zachary Hill","username":"zHill","avatar_template":"/letter_avatar_proxy/v4/letter/z/9de053/{size}.png","created_at":"2023-02-08T20:31:44.429Z","cooked":"<p>Our team is trying to implement path planner into our auton this year. We are trying to use the SwerveAutoBuilder, however it has the error that our constructor is undefined. It says it’s undefined because our Module State Consumer, m_controller::setState, is not being read as a ModuleState consumer. We had a similar error with the pose2D consumer and supplier but I was able to fix those with no problem. The setState method however is still giving me and the rest of a programming team a headache. Thanks in advance.</p>
<p>This is the error message we’ve been getting:</p>
<pre><code class="lang-auto">The constructor SwerveAutoBuilder(Supplier&lt;Pose2d&gt;, Consumer&lt;Pose2d&gt;, SwerveDriveKinematics, PIDConstants, PIDConstants, m_controller::setState, HashMap&lt;String,Command&gt;, boolean, drive) is undefinedJava(134217858)
</code></pre>
<p>Here is the SwerveAutoBuilder code:</p>
<pre><code class="lang-auto">public Command getAutonomousCommand() {

    ArrayList&lt;PathPlannerTrajectory&gt; pathGroup = (ArrayList&lt;PathPlannerTrajectory&gt;) PathPlanner.loadPathGroup("Auton Test path", new PathConstraints(4, 3));

    HashMap&lt;String, Command&gt; eventMap = new HashMap&lt;&gt;();
    eventMap.put("marker1", new PrintCommand("Passed marker 1"));

    SwerveAutoBuilder autoBuilder =  new SwerveAutoBuilder(
      m_controller::getPose, // Pose2d supplier
      SwerveWheelController::resetOdometry, // Pose2d consumer, used to reset odometry at the beginning of autokDriveKinematics, // SwerveDriveKinematics
      kDriveKinematics,
      new PIDConstants(5.0, 0.0, 0.0), // PID constants to correct for translation error (used to create the X and Y PID controllers)
      new PIDConstants(0.5, 0.0, 0.0), // PID constants to correct for rotation error (used to create the rotation controller)
      m_controller::setState, // Module states consumer used to output to the drive subsystemeventMap,
      eventMap,
      true, // Should the path be automatically mirrored depending on alliance color. Optional, defaults to true
      m_Drive // The drive subsystem. Used to properly set the requirements of path following commands
    );

Command fullAuto = autoBuilder.fullAuto(pathGroup);
</code></pre>
<p>Here is the setState code:</p>
<pre><code class="lang-auto">public void setState(SwerveModuleState[] moduleStates) {
    SwerveDriveKinematics.desaturateWheelSpeeds(moduleStates, maxAttainableSpeed);
    frontLeftModule.setDesiredState(moduleStates[0]);
    frontRightModule.setDesiredState(moduleStates[1]);
    backLeftModule.setDesiredState(moduleStates[2]);
    backRightModule.setDesiredState(moduleStates[3]);
  }
